  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the National Wildlife
  Refuge Visitor Survey for Cabo Rojo NWR and is part of the USGS Data Series 643.
  The survey was conducted to better understand visitor needs and experiences and
  to design programs and facilities that respond to those needs. Key findings for
  the Refuge include visitor and trip characteristics, visitor spending in the local
  community, visitor opinions about the Refuge, and visitor opinions about the Refuge
  System.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
